package com.mtailor.meetrics.service;

import org.junit.jupiter.api.Assertions;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.Test;

import static org.junit.jupiter.api.Assertions.assertEquals;


class Base64SvgSplitterTest {

    private static final String BASE64_PART = "";
    private static final String METADATA = "data:image/svg+xml;charset=utf-8;base64,";

    private Base64SvgSplitter base64SvgSplitter;

    @BeforeEach
    public void setUp() {
        base64SvgSplitter = new Base64SvgSplitter();
    }

    @Test
    public void shouldDecodeCallBase64DecoderWithoutMetadata() {
        //given
        String input = METADATA + BASE64_PART;

        //when
        String result = base64SvgSplitter.getPureBase64(input);

        //then
        assertEquals(BASE64_PART, result);
    }

    @Test
    public void shouldDecodeThrowIllegalArgumentException() {
        //given
        String input = "";

        //when
        Assertions.assertThrows(IllegalArgumentException.class, () -> base64SvgSplitter.getPureBase64(input));

        //then
    }
}